import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'react-bootstrap';
//import Cabecalho from '../componentes/cabecalho';
import NavSc from '../componentes/navbar';
import Table from 'react-bootstrap/Table';
import Bootfooter from '../componentes/BSfooter';
import logo5 from '../logo5.png';
import logo6 from '../logo6.png';


function Salas() {
  
  const [tableData, setTableData] = useState([]);
  
  useEffect(() => {
      async function fetchTableData () {
      
      try {
        
        const response = await axios.get('http://localhost:2527/api/salas');
        console.log('resposta' + response.data);
        setTableData(response.data);
      } catch (error) {
        console.error(error);
      }
  
      };
      fetchTableData();
    },[]); 
  
  return (    

    <Container fluid>
      <Row>
        <Col xs={12}>
        <NavSc />
        </Col>
      </Row>
     
      <Row>
          <Table fluid striped bordered hover variant="light">
          <thead>
            <tr>
              <th>imgLink</th>
              <th>Numero</th>
              <th>Capacidade</th>
              <th>Descrição</th>
              <th>Valor</th>
              <th>Update</th>
              <th>Delete</th>
            </tr>
          </thead>
          <tbody>
          {tableData.map((row, index) => {
              return (
            <tr key={index} data-toogle="tooltip" title={row.imgsala}>
                <td>{row.imgsala}</td>
                <td>{row.numero}</td>
                <td>{row.capacidade}</td>
                <td>{row.descricao}</td>
                <td>{row.valor}</td>
                <td><a href={`/salas/${row._id}`}>
                  <img src={logo5} ></img>
                  </a>
                </td>
                <td><a href={`/salas/${row._id}`}>
                  <img src={logo6}></img>
                  </a>
                </td>
            </tr>
          );
          })}
          </tbody>
           </Table>
      </Row>

        <Bootfooter/>

    </Container>
  );
}

export default Salas;
